import VueRouter from 'vue-router'
import Vue from 'vue'
import Login from '../components/Login'

Vue.use(VueRouter)

const routes = [
  {
    path:"/login",
    name:"login",
    component:Login
  },
]

const router = new VueRouter({
  mode: 'history',
  base: process.env.BASE_URL,
  routes
})

router.beforeEach((to,from,next)=>{

})

export default router
